B.PA=new A.my("Il trattamento delle risposte e dei dati da lei forniti \xe8 finalizzato alla realizzazione di una ricerca scientifica relativa all\u2019applicazione delle neuroscienze nella caratterizzazione dei processi decisionali.\n\nI dati raccolti attraverso il questionario sono utilizzati solo a scopo di ricerca e verranno elaborati esclusivamente dal gruppo di ricerca dell\u2019Universit\xe0 di Camerino (UNICAM).\n\nLa partecipazione al questionario \xe8 volontaria.\n\nI dati raccolti attraverso il questionario non sono riconducibili in alcun momento alla persona che li ha forniti, da parte del team di ricerca. I report redatti per la presentazione dei risultati della ricerca non potranno contenere in nessun modo informazioni che consentano di identificare coloro che hanno conferito i dati.\n\nSi precisa che le credenziali per usare l'applicazione sono fornite dal personale Unicam e che i dati conferiti non consentono l\u2019identificazione o l\u2019identificabilit\xe0 del soggetto che risponde al questionario e in tal senso non sono definibili come dati personali ai sensi della normativa di legge.\n\nI risultati della ricerca saranno comunicati in pubblicazioni scientifiche e a conferenze, e resi pubblici solo in forma aggregata e totalmente anonima.\n\nIl trattamento dei dati personali effettuato da UNICAM \xe8 improntato ai principi elencati all\u2019art. 5 del Regolamento UE 2016/679.\n\nIl titolare del loro trattamento \xe8 l\u2019Universit\xe0 degli Studi di Camerino che ha sede legale in Camerino, Piazza Cavour 19/f \u2013 Camerino MC (la sede operativa, a seguito dell\u2019inagibilit\xe0 post- sisma della sede di Piazza Cavour, \xe8 in via D\u2019Accorso 16 \u2013 Rettorato \u2013 Campus Universitario). I dati di contatto del titolare sono:\nPEC: protocollo@pec.unicam.it\n\nL\u2019Universit\xe0 degli Studi di Camerino ha designato quale Responsabile della Protezione dei Dati Personali il Dott. Stefano Burotti. I suoi recapiti di contatto sono i seguenti:\nE-mail: rpd@unicam.it\nP.E.C.: rpd@pec.unicam.it\n\nL\u2019interessato ha il diritto di esercitare i diritti indicati nella sezione 2, 3 e 4 del Capo III del GDPR,  ove applicabile.\n\nL\u2019interessato ha il diritto di proporre reclamo al Garante per la Protezione dei Dati se ritiene che il trattamento di dati personali che lo riguardi violi il Regolamento EU 2016/2016, ai sensi e nelle modalit\xe0 dell\u2019art. 77 di detto Regolamento.",null,B.cX,null)
B.PB=new A.my("Sogniario \xe8 un'app creata per registrare e catalogare i tuoi sogni.\n\nPrende nota della qualit\xe0 del tuo sonno e delle caratteristiche dei tuoi sogni. Inoltre registra vocalmente la descrizione del tuo sogno.\n\nAnalizza la complessit\xe0 del sogno attraverso tecniche di neurolinguistica e riporta grafi e nuvole di parole per una visualizzazione intuitiva del contenuto del sogno. Permette di tener traccia della qualit\xe0 del tuo sonno e dei sogni mediante la funzione calendario.\n\nSogniario nasce da una collaborazione tra il Brain and Sleep Research Laboratory dell\u2019Universit\xe0 di Camerino e il Molecular Mind Laboratory della Scuola IMT Alti Studi Lucca. Ha lo scopo di aiutare gli scienziati a comprendere il funzionamento del cervello alla base dell\u2019esperienza cosciente durante il sonno.",null,B.cX,null)
